-- 테이블 dobbyDB.caldav_calendar_info 구조 내보내기
CREATE TABLE IF NOT EXISTS `caldav_calendar_info` (
  `calendar_id` varchar(50) NOT NULL COMMENT '캘린더ID',
  `calendar_name` varchar(100) DEFAULT NULL COMMENT '캘린더 이름',
  `calendar_tag` varchar(30) DEFAULT NULL COMMENT '캘린더 태그',
  `create_dt` datetime NOT NULL DEFAULT current_timestamp() COMMENT '캘린더 생성일',
  `update_dt` datetime NOT NULL DEFAULT current_timestamp() COMMENT '캘린더 수정일',
  `delete_dt` datetime DEFAULT NULL COMMENT '캘린더 삭제일',
  PRIMARY KEY (`calendar_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- 테이블 데이터 dobbyDB.caldav_calendar_info:~1 rows (대략적) 내보내기

-- 테이블 dobbyDB.caldav_event_info 구조 내보내기
CREATE TABLE IF NOT EXISTS `caldav_event_info` (
  `event_idx` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '이벤트순번',
  `event_id` varchar(200) NOT NULL COMMENT '이벤트ID',
  `calendar_id` varchar(50) NOT NULL COMMENT '캘린더ID',
  `event_name` varchar(100) DEFAULT NULL COMMENT '이벤트 이름',
  `start_dt` datetime NOT NULL COMMENT '이벤트 시작일시',
  `end_dt` datetime NOT NULL COMMENT '이벤트 종료일시',
  `event_tag` varchar(30) NOT NULL COMMENT '이벤트 태그',
  `wid` varchar(30) NOT NULL COMMENT 'wid',
  `create_user` varchar(30) DEFAULT NULL COMMENT '이벤트 생성자',
  `update_user` varchar(30) DEFAULT NULL COMMENT '이벤트 수정자',
  `create_dt` datetime NOT NULL COMMENT '이벤트 생성일',
  `update_dt` datetime NOT NULL COMMENT '이벤트 수정일',
  `delete_dt` datetime DEFAULT NULL COMMENT '이벤트 삭제일',
  PRIMARY KEY (`event_idx`),
  KEY `FK_CALENDAR_ID` (`calendar_id`),
  CONSTRAINT `FK_CALENDAR_ID` FOREIGN KEY (`calendar_id`) REFERENCES `caldav_calendar_info` (`calendar_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3365 DEFAULT CHARSET=utf8mb4;

-- 테이블 데이터 dobbyDB.caldav_event_info:~918 rows (대략적) 내보내기

-- 테이블 dobbyDB.dateKind 구조 내보내기
CREATE TABLE IF NOT EXISTS `dateKind` (
  `kind_num` varchar(2) NOT NULL,
