  PRIMARY KEY (`kind_num`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- 테이블 데이터 dobbyDB.dateKind:~4 rows (대략적) 내보내기

-- 테이블 dobbyDB.dayoff_default 구조 내보내기
CREATE TABLE IF NOT EXISTS `dayoff_default` (
