  `default_dayoff` int(11) NOT NULL,
  PRIMARY KEY (`year`)
) ENGINE=InnoDB AUTO_INCREMENT=32 DEFAULT CHARSET=utf8mb4;

-- 테이블 데이터 dobbyDB.dayoff_default:~31 rows (대략적) 내보내기

