-- 테이블 dobbyDB.dayoff_history 구조 내보내기
CREATE TABLE IF NOT EXISTS `dayoff_history` (
  `dayoff_idx` int(11) NOT NULL AUTO_INCREMENT COMMENT '연차순번',
  `employee_no` varchar(5) NOT NULL COMMENT '사원번호',
  `event_idx` bigint(20) NOT NULL COMMENT '이벤트 순번',
  `dayoff_type` varchar(20) NOT NULL COMMENT '연차 종류(syscode.code_group[DAY_OFF])',
  `dayoff_dt` datetime NOT NULL COMMENT '연차사용일',
  `dayoff_reason` text DEFAULT NULL COMMENT '연차 사유',
  `approver_no` varchar(5) DEFAULT NULL COMMENT '승인자 사원번호',
  `approval_dt` datetime DEFAULT NULL COMMENT '승인일',
  `approval_msg` text DEFAULT NULL COMMENT '승인/거절 메시지',
  `memo` text DEFAULT NULL COMMENT '슈퍼 관리자 메모',
  `create_dt` datetime NOT NULL DEFAULT current_timestamp() COMMENT '생성일',
  `creator_id` varchar(15) NOT NULL COMMENT '생성자',
  `update_dt` datetime DEFAULT NULL COMMENT '수정일',
  `updator_id` varchar(15) DEFAULT NULL COMMENT '수정자',
  PRIMARY KEY (`dayoff_idx`)
) ENGINE=InnoDB AUTO_INCREMENT=4160 DEFAULT CHARSET=utf8mb4 COMMENT='연차 사용 내역';

-- 테이블 데이터 dobbyDB.dayoff_history:~740 rows (대략적) 내보내기

-- 테이블 dobbyDB.department 구조 내보내기
CREATE TABLE IF NOT EXISTS `department` (
  `department_no` int(11) NOT NULL AUTO_INCREMENT COMMENT '부서번호',
  `parent_department_no` int(11) DEFAULT NULL COMMENT '상위 부서 번호',
  `department_name` varchar(20) NOT NULL COMMENT '부서명',
  `create_dt` datetime NOT NULL COMMENT '생성일',
  `creator_id` varchar(15) NOT NULL COMMENT '생성자',
