-- 테이블 dobbyDB.employee 구조 내보내기
CREATE TABLE IF NOT EXISTS `employee` (
  `employee_no` varchar(5) NOT NULL COMMENT '사원번호',
  `rank_no` int(11) NOT NULL COMMENT '직급번호',
  `department_no` int(11) NOT NULL COMMENT '부서번호',
  `password` varchar(30) NOT NULL COMMENT '암호',
  `name` varchar(10) NOT NULL COMMENT '사원명',
  `joining_dt` datetime NOT NULL COMMENT '입사년월',
  `leaving_dt` datetime DEFAULT NULL COMMENT '퇴사년월',
  `auth` varchar(10) DEFAULT NULL COMMENT '권한 - 슈퍼관리자: admin, 일반관리자: approval, 일반: employee',
  `create_dt` datetime NOT NULL COMMENT '생성일',
  `creator_id` varchar(15) NOT NULL COMMENT '생성자',
  `update_dt` datetime DEFAULT NULL COMMENT '수정일',
  `updator_id` varchar(15) DEFAULT NULL COMMENT '수정자',
  `delete_dt` datetime DEFAULT NULL COMMENT '삭제일',
  `deletor_id` varchar(15) DEFAULT NULL COMMENT '삭제자',
  PRIMARY KEY (`employee_no`),
  KEY `department_no` (`department_no`),
  KEY `rank_no` (`rank_no`),
  CONSTRAINT `FK_DEPARTMENT_NO` FOREIGN KEY (`department_no`) REFERENCES `department` (`department_no`),
  CONSTRAINT `FK_RANK_NO` FOREIGN KEY (`rank_no`) REFERENCES `rank` (`rank_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='사원 정보';

-- 테이블 데이터 dobbyDB.employee:~32 rows (대략적) 내보내기

